import React from 'react';
import './App.css';
import Tasks from './xample/tasks.json';

  state = {
    tasks: Tasks
  }

class App extends React.Component {
  render() {
    return <div>
      (this.state.tasks.map(response => <ul><li>(response.task)</li></ul>))
    </div>
  }
}

export default App;
